import { Link } from 'react-router-dom';
import './LandingStyles.css';

export default function LandingComponent () {
    return (
        <div className="bou">
            <button type="button" class="btn btn-secondary btn-dark">
                <Link exact to="/dogs" >Home</Link>
                </button>
        </div>
    )

       
}
